import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { 
  MapPin, 
  Car, 
  Cloud, 
  Settings, 
  Play, 
  ArrowLeft,
  Zap,
  Leaf,
} from 'lucide-react';
import './SimulationSetup.css';

const SimulationSetup = () => {
  const navigate = useNavigate();
  const [selectedTrack, setSelectedTrack] = useState('');
  const [modelVersion, setModelVersion] = useState('ppo');
  const [tracks, setTracks] = useState([]);
  const [models, setModels] = useState({});
  const [loading, setLoading] = useState(true);
  const [starting, setStarting] = useState(false);

  useEffect(() => {
    loadData();
  }, []);

  const loadData = async () => {
    try {
      setLoading(true);
      // Load tracks and models in parallel
      const [tracksResponse, modelsResponse] = await Promise.all([
        fetch('http://localhost:5000/api/tracks'),
        fetch('http://localhost:5000/api/models/available')
      ]);
      
      const tracksData = await tracksResponse.json();
      const modelsData = await modelsResponse.json();
      
      setTracks(tracksData);
      setModels(modelsData);
    } catch (error) {
      console.error('Failed to load data:', error);
      // Fallback data
      setTracks(['Catalunya', 'Spielberg', 'Silverstone', 'Monza', 'Spa']);
      setModels({
        'ppo': { name: 'PPO Multi-Track', description: 'Proximal Policy Optimization' },
        'sac': { name: 'SAC Single-Track', description: 'Soft Actor-Critic' }
      });
    } finally {
      setLoading(false);
    }
  };

  const handleStartSimulation = async () => {
    if (!selectedTrack) {
      alert('Please select a track');
      return;
    }

    setStarting(true);

    const config = {
      track: selectedTrack,
      model_version: modelVersion,
      user: 'web_user'
    };

    localStorage.setItem('simulationConfig', JSON.stringify(config));
    
    // Start the simulation immediately
    try {
      const response = await fetch('http://localhost:5000/api/simulation/start', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(config)
      });

      const result = await response.json();
      
      if (result.simulation_id) {
        localStorage.setItem('simulationId', result.simulation_id);
        localStorage.setItem('simulationStatus', result.status || 'started');
        navigate('/dashboard');
      } else {
        alert('Failed to start simulation: ' + (result.error || 'Unknown error'));
      }
    } catch (error) {
      console.error('Failed to start simulation:', error);
      alert('Failed to start simulation: ' + error.message);
    } finally {
      setStarting(false);
    }
  };

  return (
    <div className="simulation-setup">
      <div className="container">
        <div className="setup-header">
          <Link to="/" className="back-button">
            <ArrowLeft size={20} />
            Back to Home
          </Link>
          <h1 className="setup-title">Simulation Setup</h1>
          <p className="setup-description">Select a track and AI model to run a one-lap simulation</p>
        </div>

        <div className="setup-content">
          <div className="setup-section">
            <div className="section-header">
              <MapPin size={24} />
              <h2>Track Selection</h2>
            </div>
            <div className="track-grid">
              {tracks.map(track => (
                <button
                  key={track}
                  className={`track-card ${selectedTrack === track ? 'selected' : ''}`}
                  onClick={() => setSelectedTrack(track)}
                >
                  <div className="track-image">
                    <div className="track-placeholder">
                      <MapPin size={32} />
                    </div>
                  </div>
                  <div className="track-info">
                    <h3>{track}</h3>
                    <div className="track-country">Racing Circuit</div>
                    <div className="track-details">
                      <span>F1 Circuit</span>
                      <span>AI Training Track</span>
                    </div>
                  </div>
                </button>
              ))}
            </div>
          </div>


          <div className="setup-section">
            <div className="section-header">
              <Settings size={24} />
              <h2>AI Model</h2>
            </div>
            <div className="model-grid">
              {Object.entries(models).map(([key, model]) => (
                <button
                  key={key}
                  className={`model-card ${modelVersion === key ? 'selected' : ''}`}
                  onClick={() => setModelVersion(key)}
                >
                  <span>{key.toUpperCase()}</span>
                  <p>{model.name}</p>
                  <small>{model.description}</small>
                  {model.trained_tracks && (
                    <div className="model-tracks">
                      <small>Trained on: {model.trained_tracks.slice(0, 3).join(', ')}{model.trained_tracks.length > 3 ? '...' : ''}</small>
                    </div>
                  )}
                  <div className="model-status">
                    <small>âœ… Ready for simulation</small>
                  </div>
                </button>
              ))}
            </div>
          </div>

          <div className="setup-actions">
            <button 
              className="start-simulation"
              onClick={handleStartSimulation}
              disabled={!selectedTrack || starting || loading}
            >
              <Play size={20} />
              {starting ? 'Starting...' : 'Start One-Lap Simulation'}
            </button>
            {loading && (
              <div className="loading-indicator">
                <small>Loading tracks and models...</small>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default SimulationSetup;
